import React, { Component, useCallback, useRef } from 'react';
import tableau from 'tableau-api';

const Analytics = () => {
  function useHookWithRefCallback() {
    const ref = useRef(null)
    const setRef = useCallback(node => {
      if (ref.current) {
        // Make sure to cleanup any events/references added to the last instance
      }

      if (node) {
        const vizUrl = 'https://public.tableau.com/app/profile/john.corwin/viz/ExampleTableau_16238599685470/Sheet1';
        const vizContainer = document.getElementById("vizContainer");
        let viz = new window.tableau.Viz(vizContainer, vizUrl)
      }

      // Save a reference to the node
      ref.current = node
    }, [])

    return [setRef]
  }

  const [ref] = useHookWithRefCallback();

  return (
    <div className="analytics" id="vizContainer" ref={ref}>
        <div className='tableauPlaceholder' id='viz1623860923163'>
            <noscript>
                <a href='#'><img alt='Sheet 1' src='https:&#47;&#47;public.tableau.com&#47;static&#47;images&#47;Ex&#47;ExampleTableau_16238599685470&#47;Sheet1&#47;1_rss.png' style='border: none' /></a>
            </noscript>
            <object className='tableauViz'  style='display:none;'>
                <param name='host_url' value='https%3A%2F%2Fpublic.tableau.com%2F' ></param>
                <param name='embed_code_version' value='3' ></param>
                <param name='site_root' value='' ></param>
                <param name='name' value='ExampleTableau_16238599685470&#47;Sheet1' ></param>
                <param name='tabs' value='no' ></param>
                <param name='toolbar' value='yes' ></param>
                <param name='static_image' value='https:&#47;&#47;public.tableau.com&#47;static&#47;images&#47;Ex&#47;ExampleTableau_16238599685470&#47;Sheet1&#47;1.png' ></param>
                <param name='animate_transition' value='yes' ></param>
                <param name='display_static_image' value='yes' ></param>
                <param name='display_spinner' value='yes' ></param>
                <param name='display_overlay' value='yes' ></param>
                <param name='display_count' value='yes' ></param>
                <param name='language' value='en-US' ></param>
                </object>
            </div>
    </div>
  );
}

export default Analytics;

